                    <SocialIcon url="https://email.com/" href="mailto:contact@test.com"/>
                    <SocialIcon url="https://facebook.com/jaketrent" /> */}
                </SocialMediaIcon>
            </MainContainer>
            <SkillContainer>
                <LanguageContainer>
                    <SkillCard title="Language and tools" >Javascript</SkillCard>
                </LanguageContainer>
                <CardContainer>
                    <Card image={webDesign}>UI/UX</Card>
                    <Card style={this.borderCss} image={webDeveloper}>Web Developer</Card>
                    <Card image={software}>Software Developer</Card>
                </CardContainer>
            </SkillContainer>
        </Wrapper>
        )
    }
}

